    }

    const a_div_style={
        margin:"20px",
    }

    return (
        <div>Guest Home page<br/>
            <div style={a_div_style}>
                <a href='/guest-view-appointment' style={a_style}>view my appointments</a>
            </div>
            <div style={a_div_style}>
                <a href='' style={a_style}>book a appointment</a>
            </div>
            <div style={a_div_style}>
                <a href='' style={a_style}>my profile</a>
            </div>
        </div>
    )

}
